        function [ signal ] = SM_wFW_b_beta_TE_RealSphHarm_quadInt(f,Da,Depar,Deperp,f_extra,T2a,T2e,plm,b,bvec,beta,TE,NlebPoints,CS_phase,epsilon_rectify)
